import React, { useState } from 'react'
import axios from 'axios'
import { useNavigate } from 'react-router-dom'
import { motion } from 'framer-motion'

export default function Register(){
  const [email, setEmail] = useState('')
  const [password, setPassword] = useState('')
  const [msg, setMsg] = useState('')
  const [otp, setOtp] = useState('')
  const [err, setErr] = useState('')
  const [awaitingOtp, setAwaitingOtp] = useState(false)
  const navigate = useNavigate()

  const onRegister = async () => {
    setErr('')
    try{
      await axios.post('/auth/register', { email, password })
      setMsg('Verification OTP sent to your email. Please enter it below to complete registration.')
      setOtp('')
      setAwaitingOtp(true)
    }catch(e){ setErr(e?.response?.data?.error || 'Register failed') }
  }

  const onVerify = async () => {
    setErr('')
    try{
      await axios.post('/auth/verify', { email, otp })
      navigate('/login')
    }catch(e){ setErr(e?.response?.data?.error || 'Verify failed') }
  }

  return (
    <div className="relative min-h-screen flex items-center justify-center overflow-hidden">
      {/* Background glows */}
      <div className="pointer-events-none absolute inset-0 -z-10">
        <div className="absolute -top-24 -left-24 w-[28rem] h-[28rem] rounded-full bg-primary/20 blur-3xl" />
        <div className="absolute -bottom-24 -right-24 w-[30rem] h-[30rem] rounded-full bg-secondary/20 blur-3xl" />
      </div>

      <motion.div initial={{opacity:0,y:20}} animate={{opacity:1,y:0}} transition={{duration:0.5}} className="w-full max-w-md">
        <div className="glass rounded-2xl border border-white/10 p-8 shadow-2xl shadow-primary/20">
          <h2 className="text-4xl font-extrabold tracking-tight">Create account</h2>
          <div className="mt-8 space-y-4">
            <div>
              <label className="text-xs text-white/60">Email</label>
              <input className="mt-1 w-full bg-white/5 border border-white/10 rounded-xl px-4 py-3 focus:outline-none focus:ring-2 focus:ring-primary/60" placeholder="you@example.com" value={email} onChange={e=>setEmail(e.target.value)} />
            </div>
            <div>
              <label className="text-xs text-white/60">Password</label>
              <input className="mt-1 w-full bg-white/5 border border-white/10 rounded-xl px-4 py-3 focus:outline-none focus:ring-2 focus:ring-primary/60" placeholder="•••••••• (min 6 chars)" type="password" minLength={6} value={password} onChange={e=>setPassword(e.target.value)} />
            </div>
            {err && <div className="text-rose-400 text-sm">{err}</div>}
            {!awaitingOtp && (
              <motion.button whileTap={{scale:0.98}} onClick={onRegister} className="w-full px-5 py-3 rounded-xl bg-gradient-to-r from-primary to-secondary shadow-lg shadow-primary/30 hover:shadow-primary/40 transition">Register</motion.button>
            )}
            {awaitingOtp && (
              <motion.div initial={{opacity:0}} animate={{opacity:1}} className="space-y-3">
                {msg && <div className="text-emerald-400 text-sm">{msg}</div>}
                <input className="w-full bg-white/5 border border-white/10 rounded-xl px-4 py-3 focus:outline-none focus:ring-2 focus:ring-primary/60" placeholder="Enter OTP" value={otp} onChange={e=>setOtp(e.target.value)} />
                <motion.button whileTap={{scale:0.98}} onClick={onVerify} className="w-full px-5 py-3 rounded-xl bg-secondary/80 hover:bg-secondary transition">Verify OTP</motion.button>
              </motion.div>
            )}
          </div>
        </div>
      </motion.div>
    </div>
  )
}
